class User {

    information ={
        Personal:{
            FirstName:'Sahar',
            LastName:'rajabi',
            Role:'User / Admin',
            Occupation:'Dermatologist',
            photo:'data:image/svg+xml;base64,'
        },
        Account:{
            PhoneNumber:'0919-11223344',
            PracticeName:'',
            EmailAddress:'sahar.rajabi@gmail.com'
        },
        Password:{
            CurrentPassword:''
        },
        Address:{
            Country:'Iran',
            City:'Tehran',
            Postalcode:'1122334455',
            TaxId:'AS123456789'
        }
    }
    constructor(info){
        if(info == undefined){
            let pak = JSON.parse(localStorage.getItem('user'))
            if(pak){
                this.information = pak
            }        
        }else{
            this.information = info
        }
    }

    updateinformation(info) {
        this.information = info
    }

    updateCustomInformation(place,value){
        if(place == 'personal'){
            this.information.Personal = {...value,photo:this.information.Personal.photo}
        }
        if(place == 'photo'){
            this.information.Personal.photo = value
        }
        if(place == 'account'){
            this.information.Account = value
        }    
        if(place == 'password'){
            this.information.Password = value
        }   
        if(place == 'Address'){
            this.information.Address = value
        }                       
        localStorage.setItem("user",JSON.stringify(this.information))
    }
}

export default User